import { Auth0Provider, useAuth0 } from '@auth0/auth0-react';
import { GoogleMap, InfoWindow, LoadScript, Marker } from "@react-google-maps/api";
import React, { useState } from 'react';
import { Navigate, Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import About from './components/About';
import Contact from './components/Contact';
import Header from './components/Header';
import Home from './components/Home';
import MyMapComponent from './components/MyMapComponent';
import Profile from './components/Profile';
import Sidebar from './components/Sidebar';

function App() {
  const { isAuthenticated, loginWithRedirect, logout } = useAuth0();

  // Add useState for farm data
  const [farm, setFarm] = useState(null); // Farm details
  const [id, setId] = useState(''); // ID input value
  const [showMap, setShowMap] = useState(false);
  const [latitude, setLatitude] = useState(-34.397);
  const [longitude, setLongitude] = useState(150.644);

  // Fetch data based on ID when user submits
  const fetchFarmData = () => {
    fetch(`http://localhost:8083/farmntech/${id}`, {
      method: "POST", // Use GET method for fetching data
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(response => response.json())
      .then(data => {
        console.log(data); // Log the fetched data for debugging
        setFarm(data); // Set the fetched farm data
        // Optionally set the latitude and longitude based on the fetched data
        // Ensure the response has latitude and longitude if needed
        // For example: setLatitude(parseFloat(data.latitude));
        // setLongitude(parseFloat(data.longitude));
      })
      .catch(error => console.error("Error fetching farm data:", error));
  };

  const handleIdChange = (e) => {
    setId(e.target.value); // Update ID state as the user types
  };

  const handleIdSubmit = (e) => {
    e.preventDefault(); // Prevent form from reloading the page
    fetchFarmData(); // Trigger the fetch when the form is submitted
  };

  const mapContainerStyle = {
    height: "400px",
    width: "800px"
  };

  const handleMapClick = () => setShowMap(true);
  const handleHideMapClick = () => setShowMap(false);
  const handleLatitudeChange = (e) => setLatitude(parseFloat(e.target.value));
  const handleLongitudeChange = (e) => setLongitude(parseFloat(e.target.value));

  return (
    <div>
      <Router>
        <Header />
        <Routes>
        <Route path="/sidebar" element={<Sidebar />} />
        <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/map" element={<MyMapComponent />} />
          <Route path="/profile" element={isAuthenticated ? <Profile /> : <Navigate to="/home" />} />
          <Route path="/" element={<Home />} />
        </Routes>
      </Router>

      {!isAuthenticated ? (
        <button onClick={loginWithRedirect}>Login</button>
      ) : (
        <>
          <form onSubmit={handleIdSubmit}>
            <label>Enter Farm ID: </label>
            <input 
              type="text" 
              value={id} 
              onChange={handleIdChange} // Update ID state when input changes
            />
            <button type="submit">Fetch Farm Data</button>
          </form>

          {/* Display fetched farm data */}
          {farm && (
            <div className='farm'>
              <h2>Farm Details</h2>
              <p>Farm No: {farm.f_no}</p>
              <p>Address: {farm.address}</p>
              <p>Quantity: {farm.qnt}</p>
            </div>
          )}

          <div className='map'>
            <label>Latitude: </label>
            <input type="number" value={latitude} onChange={handleLatitudeChange} />
            <label>Longitude: </label>
            <input type="number" value={longitude} onChange={handleLongitudeChange} />
          </div>

          <button onClick={handleMapClick}>Show Map</button>
          <button onClick={handleHideMapClick}>Hide Map</button>
          <button onClick={() => logout({ returnTo: window.location.origin })}>Logout</button>
        </>
      )}

      {showMap && (
        <LoadScript googleMapsApiKey="AIzaSyC1h_ObXgGBpji0Z2koTTQp5qhPbvmUckc">
          <GoogleMap
            mapContainerStyle={mapContainerStyle}
            center={{ lat: latitude, lng: longitude }}
            zoom={14}
          >
            <Marker position={{ lat: latitude, lng: longitude }} />
            <InfoWindow position={{ lat: latitude, lng: longitude }}>
              <div>Info Window Content</div>
            </InfoWindow>
          </GoogleMap>
        </LoadScript>
      )}
    </div>
  );
}

// Wrap App component with Auth0Provider
const Root = () => (
  <Auth0Provider
    domain="dev-0va1gvwgwfk0n27p.us.auth0.com"
    clientId="G4oOtJbNvzl9dn8c4bSdoa5EdZsxoOIk"
    authorizationParams={{
      redirect_uri: window.location.origin
    }}
  >
    <App />
  </Auth0Provider>
);

export default Root;
